import { StyleSheet } from "react-native";

export default StyleSheet.create({
    body: {
        display: 'flex',
        alignItems: 'center',
        backgroundColor: '#252525',
        height: '100%',
    }, 
    title: {
        color: '#fff',
        fontSize: 24
    }
})
